INSERT INTO `swnewsitemdata` (`newsitemdataid`, `newsitemid`, `contents`) VALUES
	(7, 7, '<span style="font-family: arial, helvetica, sans-serif;">Great news!!! Since you had been liking our service, we will allow your views to be spread over several videos with a minimum of 5,000 views per video, e.g you place an order for 10,000 views, you can spread that 10,000 views over 2 videos&nbsp;at 5,000 views per video. The more views you have, the more credible your video becomes. Delivery time frame will be the same for respective quantity. We guarantee you that views will be delivered as fast as possible.</span>'),
	(8, 8, '<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="text-decoration: underline;">Active Type Twitter Followers</span> &ndash; <em>Real people and very active on twitter. Log in most of the time. We use follow first method. We need your username and password so we can log in to your account and follow people that would likely follow back.</em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>Advantage: </em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>[1]Very active users to interact with.</em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>Disadvatanges: </em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>[1] We need your username and password </em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>[2] Your following number will definitely increase as we&nbsp; have to follow people on your behalf. </em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>[3] Has a slight price difference compared to the Inactive type</em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>&ldquo;Ideal for users who are into interaction&rdquo;</em></span></p>\n<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><span style="text-decoration: underline;">Inactive Type Twitter Followers</span> &ndash; <em>Still real people but not that active on twitter. Logged in once in a while. We send the followers directly to your account. We only need username.</em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>Disadvantage: Not Active</em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>Advantages: </em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>[1] No need to provide us with your password for</em><em>&nbsp;we will send those followers directly to your account.</em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>[2] Following number will never increase because we won&rsquo;t be following people on your behalf. </em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>[3] Cheaper compared to the other type</em></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><em>&ldquo;Ideal for users who want to increase the&nbsp;<em>credibility of your twitter</em>&nbsp;accounts</em></span></p>'),
	(10, 10, '<span style="font-size: small; font-family: arial, helvetica, sans-serif;"><span style="text-decoration: underline;"><em>Buy Real Marketing Client Portal</em></span> is a "1 stop shop" for all of our beloved customers\' social media needs. Vimeo views, YouTube views, Soundcloud plays, twitter followers etc. Everything you need to increase the crediblity of your social media accounts is here. Come join us. Register with your functional email address and be one of thousands of users to experience high quality social media service.</span>'),
	(12, 12, '<p><span style="font-size: small;">Since you have been liking our service, we are providing discounts on higher amount of funds.</span></p>\n<p><span style="font-size: small;">$500 - 3% ($20)</span></p>\n<p><span style="font-size: small;">$1000 - 5% ($50)</span></p>\n<p><span style="font-size: small;">$2500 - 10% ($250)</span></p>'),
	(14, 14, '<p><span style="font-size: small;">Greetings!!!!</span></p>\n<p><span style="font-size: small;">Our SoundCloud download service is up. Start increasing your track\'s downloads. Feel free to place your SoundCloud download orders and we\'ll take care of them.</span></p>\n<p><span style="font-size: small;">Thank you</span></p>'),
	(15, 15, '<p>Apologies. Our Facebook service is currently unavailable due to system enhancement. Please bear with us.</p>\n<p>Thank you</p>'),
	(16, 16, '<p><strong>Greetings!!!</strong></p>\n<p><strong>In order for us to serve you better and provide high quality service, we gave our Client Portal a new look and added some features. We hope you\'ll like it.</strong></p>\n<p><strong>Thank you</strong></p>\n<p><strong>Buy Real Marketing</strong></p>'),
	(17, 17, '<p><span style="font-size: large;"><em><strong>Greetings!!! Please clear your browser\'s cache to see the new updates/features.</strong></em></span></p>\n<p><span style="font-size: large;"><em><strong>Thank you</strong></em></span></p>\n<p><span style="font-size: large;"><em><strong>Buy Real Marketing</strong></em></span></p>'),
	(18, 18, '<p>Greetings!!</p>\n<p>Please bear with us in the mean time. We will have a system maintenance on our SoundCloud service. It will take 24-48 hours or sooner. We would really appreciate some of your understanding about this matter. Thank you for bearing with us.</p>\n<p>Buy Real Marketing</p>');
